Процессор: i5-7200U 2.50 GHz  2.70GHz;
Ram: 8gb; 
Видеокарта: Nvidia Geforce 920MX 2gb VRam;
SSD 128 Gb;
HDD 1T;
Батарея очень хорошо держит (2 или 3 часа) зависимости от работы (при просмотре фильма 4 часа )
